  rewind(data, true);
  return data;
}
function extentToCoord(coord, extent) {
  return coord ? coord : [
    [extent[0], extent[3]],
    [extent[2], extent[3]],
    [extent[2], extent[1]],
    [extent[0], extent[1]]
  ];
}
export {
  extentToCoord,
  geojsonRewind,
  getColumn,
  isNumberArray,
  isRasterFileData,
  isRasterFileDataArray
};
